import React from 'react';

const sample = [
  {
    id: 'p1',
    title: 'Clean Dashboard UI',
    desc: 'Lightweight dashboard with real-time updates and accessibility-first patterns.',
    tags: ['React', 'UI'],
    url: '#',
    image: 'https://via.placeholder.com/320x200?text=Dashboard',
  },
  {
    id: 'p2',
    title: 'Medical Imaging — Brain Tumor',
    desc: 'Prototype demonstrating attention maps and explainability in segmentation models.',
    tags: ['ML', 'Imaging'],
    url: '#',
    image: 'https://via.placeholder.com/320x200?text=Imaging',
  },
  {
    id: 'p3',
    title: 'Marketing Landing',
    desc: 'High-performance, A/B-ready landing with animated hero and optimized assets.',
    tags: ['HTML', 'CSS', 'Performance'],
    url: '#',
    image: 'https://via.placeholder.com/320x200?text=Landing',
  },
];

export default function Projects() {
  return (
    <section id="projects" className="container section projects">
      <h2 className="section-title">Selected Projects</h2>
      <p className="section-sub">A concise selection of recent work — focused on clarity and impact.</p>

      <div className="projects-grid">
        {sample.map((p) => (
          <article key={p.id} className="project-card card">
            <div className="thumb" style={{ backgroundImage: `url(${p.image})` }} aria-hidden="true" />
            <div className="project-body">
              <h3 className="project-title">{p.title}</h3>
              <p className="desc">{p.desc}</p>

              <div className="meta">
                <div className="tag-list">
                  {p.tags.map((t) => (
                    <span key={t} className="tag">{t}</span>
                  ))}
                </div>

                <a className="btn view-btn" href={p.url} aria-label={`View ${p.title}`}>View</a>
              </div>
            </div>
          </article>
        ))}
      </div>
    </section>
  );
}
